import React from 'react';
import { Button } from '@mui/material';
import axios from 'axios';

const DownloadButton = ({ results }) => {
	const handleDownload = async () => {
	  try {
	    const response = await axios.post(
	      'http://localhost:8080/api/trench/excel',
	      results, // Ensure 'results' contains the expected structure
	      {
	        headers: { 'Content-Type': 'application/json' }, // Ensure correct Content-Type
	        responseType: 'blob', // Expect binary data for file download
	      }
	    );
	    const url = window.URL.createObjectURL(new Blob([response.data]));
	    const link = document.createElement('a');
	    link.href = url;
	    link.setAttribute('download', 'trench_results.xlsx');
	    document.body.appendChild(link);
	    link.click();
	  } catch (error) {
	    console.error('Error downloading Excel:', error.response || error.message || error);
	  }
	};

  return (
    <Button
      variant="contained"
      color="primary"
      style={{ marginTop: '10px' }}
      onClick={handleDownload}
    >
      Download Excel Sheet
    </Button>
  );
};

export default DownloadButton;
